import React, { Component } from 'react'
import Head from 'next/head'
import Layout from '../components/Layout'
import Hero from '../components/Hero'
import JumboCard from '../components/JumboCard'

export class index extends Component {
  render() {
    const title= "Temasek Holdings"
    return (
      <div className="main">
        <Head>
        <title>I'm Marcus Foo</title>
        </Head>
        <Layout />
        <Hero />   
        <div className="headerContainer">
          <div className="line"></div>
          <h1 className="headerIntro" >Here's what I've done so far</h1>
          <div className="line"></div>
        </div>
        

       <style jsx>{`
            .main {
              overflow: hidden;
            }
            .headerContainer {
              display: flex;
              justify-content: center;
            }

            .headerIntro {
              text-align: center;
              color: black;
              margin: 55px 10px;
              font-size: 1.5rem;
              font-weight: bold;
            }

            .line {
              width: 25vw;
              height: 5px;
              background: #404040;
              margin: 70px 2vw;
              border-radius: 15px;
            }
       `} </style> 
       <JumboCard title = {title}/>
      </div>
    )
  }
}

export default index
